import React from 'react'
import { Route, Redirect } from "react-router-dom";

const PrivateRoute = ({ component: Component, ...rest }) => {

	return (
		<Route
			{...rest}
			render={
				props => {

					return (localStorage.getItem("token")) ? (
						<Component {...props} />
					) : (
							<Redirect to="/login" />
						)
				}
			}
		/>
	);
}

export default PrivateRoute;
